import { Typography } from "@mui/material";
import { FC } from "react";
import { text } from "stream/consumers";

interface Props{
    text:string,
    size:string,

}

const MyTypography:FC<Props> = ({text,size}) =>{
    return(
        <Typography
            sx={{
                fontSize:size,
                letterSpacing
            }}
        >
            {text}
        </Typography>
    );
}

export default MyTypography;
